import { Box } from "./box.model";

export class TicketBox {
  name: string;
  boxes: Box[];
  superzahl: number | null;
  dateCreation: number;
  constructor(boxes:Box[],superzahl: number | null, dateCreation:number) {
    this.name = "default ticket name";
    this.boxes = boxes;
    this.superzahl = superzahl;
    this.dateCreation = dateCreation;
  }
}
